import { blue } from "@mui/material/colors";
import React from "react";
// import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
const Successcard2=()=>{
    return(
        <React.Fragment>
            <div class="container">
  <div className="row">
    <div className="col-sm"><div class="card">
  <img class="card-img-top" src="https://imagecdn.jeevansathi.com/39320/19/786419405-1689100418.jpg" alt="Card image cap" height="300"/>
  <div class="card-body">
    <h5 class="card-title" style={{fontFamily:'initial',fontSize:30}}>Sangram weds Rohini Davane</h5>
    <p class="card-text" style={{fontSize:15,fontFamily:'inherit',color:'green'}}>We met on EliteLove in the mid of April. Then we started to know each other more with free chat facility by EliteLove..  I was very glad that I am soon going to get someone special in my life.Our families met and they liked each other too .soon we have realized that we are made for each other.. our nature,habits are similar. then we decided to proceed further. All thanks to this app. Thank you Team.</p>
    {/* <a href="#" class="btn btn-primary">Go somewhere</a> */}
  </div>
</div></div>
    <div className="col-sm"><div class="card">
  <img class="card-img-top" src="https://imagecdn.jeevansathi.com/39354/15/787095689-1689183743.jpg" alt="Card image cap" height="300"/>
  <div class="card-body">
    <h5 class="card-title" style={{fontFamily:'initial',fontSize:30}}>Pradip Govinda weds Karishma Israni</h5>
    <p class="card-text" style={{fontSize:15,fontFamily:'inherit',color:'green'}}>We met through EliteLove matrimony and then it began. Our family found contact for each other and we married happily ever after in 2008.We can't thank enough to our stars and almighty to make us meet and become the "one". Heartedly Thanks to EliteLove for making this happen.</p>
    {/* <a href="#" class="btn btn-primary">Go somewhere</a> */}
  </div>
</div></div>
    <div className="col-sm"><div class="card">
  <img class="card-img-top" src="https://imagecdn.jeevansathi.com/39355/9/787109419-1689185123.jpg" alt="Card image cap" height="300"/>
  <div class="card-body">
    <h5 class="card-title" style={{fontFamily:'initial',fontSize:30}}>Amit Kumar Sharma weds Shashi Bala</h5>
    <p class="card-text" style={{fontSize:15,fontFamily:'inherit',color:'green'}}>We met through jeevansathi and had initial phone conversation. There was equal energy from Priyanka's side also. Surprisingly, we met within 3 days of first call, it seems our vibes were matching and started to click each other. We spent a lot of good time together. We met again but calling it a date.</p>
    {/* <a href="#" class="btn btn-primary">Go somewhere</a> */}
  </div>
</div></div>
  </div>
</div>
        </React.Fragment>
    )
}
export default Successcard2;
